<template>
	<view class="my-clock">
		<view class="hedar-wrap" >
			<view class="header-bg-top"></view>
			<view class="goback" @click="back">
				<image class="goback-img" src="/static/images/goBack.png" mode=""></image>
				<text class="">我的打卡</text>
			</view>
		</view>
		<view class="content-wrap">
			<view class="clock-item" v-for="(item, index) in myrecordDatas" :key="index" @tap="goDetail(item.lv_id)">
				<view class="clock-time">
					<text>打卡时间：</text>
					<text>{{format(item.add_time)}}</text>
				</view>
				<view class="clock-info-content">
					<view class='pictrue'  >
						<image :src='item.image'></image>
					</view>
					<view class="right-info">
						<view class='text'>
							<view class='name line1'>{{item.lvyou_name}}</view>
							<view class='describe line1'>{{item.lvyou_info}} </view>
						</view>
						<view class="clock-in">
							<view class="clock-color">
								<text>打卡人数:</text>
								<!-- <text ><text class="clock-number">{{item.clock_people}}</text>人</text> -->
							</view>
						</view>
					</view>
				</view>
			</view>
		</view>
		<view class="empty-txt" v-if="!isScroll">到底了~</view>
	</view>
</template>

<script>
	import { getMyrecord } from "@/api/traveApi.js";
	export default {
		data() {
			return {
				page:1,
				limit:10,
				isScroll: true,
				myrecordDatas:[]
			}
		},
		methods: {
			back(){
				uni.navigateBack()
			},
			
			// 格式化时间
			format(d){
				let date=new Date(d)
				let year = date.getFullYear();
				let month = date.getMonth() + 1 < 10 ? "0" + (date.getMonth() + 1) : date.getMonth() + 1;
				let day = date.getDate() < 10 ? "0" + date.getDate() : date.getDate();
				let hours = date.getHours() < 10 ? "0" + date.getHours() : date.getHours();
				let minutes = date.getMinutes() < 10 ? "0" + date.getMinutes() : date.getMinutes();
				let seconds = date.getSeconds() < 10 ? "0" + date.getSeconds() : date.getSeconds();
		
				return year + "年" + month + "月" + day+"日";
			
			},
			//获取列表数据
				
			getMyrecordDatas(data){
				if (!this.isScroll) return
				let that =this;
				getMyrecord(data).then((res)=>{
					that.isScroll = res.data.length >= that.limit
					that.myrecordDatas = [...this.myrecordDatas,...res.data[0]];
				})
			},
			goDetail(id){
				uni.navigateTo({
					url: `/pages/goods_details/index?id=${id}`
				})
			}
			
			
		},
		onPullDownRefresh() {
		
		},
		onReachBottom() {
			this.page++;
			let data={
				page:this.page,
				limit:this.limit
			}
			this.getMyrecordDatas(data)
		},
		created() {
			let data={
				page:this.page,
				limit:this.limit
			}
			this.getMyrecordDatas(data)
		}
	}
</script>

